import changeVolume from '../actions/changeVolume';

const defaultState = false;

function reducer(state = defaultState, action) {
    switch (action.type) {
        case 'changeVolume': {
            return Object.assign({}, state, action.payload)
        }

        default:
            return state;
    }
}

export default reducer;
